export async function getDeliveryLists(order = 'deliveryDate') {
    const query = `order=${order}`;
    const baseUrl = "https://gist.githubusercontent.com/bluefoginthecup/11b28fabc21b551cbfd585c38cccf621/raw/7030621ed96a6f9b1bc95d49c4989d9c54aff08b/mock.json"
    const response = await fetch(
         `{baseUrl${query}`
    );
    const body = await response.json();
    return body;
}



